.countdown {
  display: grid;
  font-weight: 400;
  grid-template-areas: ". hour min sec" "rem hourTime minTime secTime";
  grid-column-gap: 1em;
  align-items: center;
  justify-content: center;
  color: #e99456;
  line-height: 1em;
  text-align: center;
  font-size: 1.8em;
}
.countdown #hour {
  grid-area: hour;
  padding: 0 0.5em;
}
.countdown #min {
  grid-area: min;
}
.countdown #sec {
  grid-area: sec;
}
.countdown .remaining {
  font-size: 1em;
  text-align: right;
  grid-area: rem;
  font-family: SofiaProSemiBold;
}
.countdown .labels {
  font-family: SofiaPro;
  font-size: 1.15em;
  grid-row: 1;
}
.countdown .time {
  grid-row: 2;
  font-size: 1.8em;
  font-family: SofiaProSemiBold;
  min-width: 1.8em;
}
